window.bookSummaryJSON = "<p><b><i>Lust. Mystery. Betrayal.</i></b></p> <p>Weston Cavendish. My brother's best friend. I'd perfected the art of pretending that I didn't want him, that he didn't affect me every time he was near.</p> <p>Or so I thought.</p> <p>When his world comes crashing down, I'm the one he turns to, and I can't deny my feelings any longer.</p> <p>I know there's something between us.</p> <p>Until he finds out that I've been hiding things from him, too.</p> <p>Broken and betrayed, can we pick up the pieces and work together to expose the truth?</p> <p>The odds are stacked against us.</p> <p>But I won't give up without a fight.</p> <p><b><i>The Fight in Us </i></b><b>is a stand-alone story but is best enjoyed after the previous three books in the series. This mature new adult romance may contain triggers for some listeners.</b></p>"; 
